import React from 'react';
import './App.css';

import { BrowserRouter as Router, Redirect, Route, Switch, } from 'react-router-dom';
import Home from "./pages/home";


function App() {
  return (
    <div className="App">
        <Router>
          <Switch>
          <Route path="/" component={Home} />
          <Redirect from="*" to="/" />
          </Switch>
        </Router>
    </div>
  );
}

export default App;
